import React, { Component } from 'react';
import { Table, Container } from 'react-bootstrap';

class Company extends Component {
  constructor(props) {
    super(props);
    this.state = {
      employees: [
        {
          id: 1,
          Name: 'eduk',
          Address: 'bgc',
          Description: 'enk'
        },
        {
          id: 2,
          Name: 'next',
          Address: 'remote',
          Description: 'wuho'
        },
        {
          id: 3,
          Name: 'rt',
          Address: 'dela rosa',
          Description: 'mmm'
        },
        {
          id: 4,
          Name: 'io',
          Address: 'pacific',
          Description: 'boo'
        },
      ],
      temp: []
    };
    this.getCompanies = async () => {
      const res = await fetch('http://localhost:1337/companies', {
        headers: {
          'Authorization': 'Bearer ' + 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6MSwiaXNBZG1pbiI6dHJ1ZSwiaWF0IjoxNTc1OTA5NTM1LCJleHAiOjE1Nzg1MDE1MzV9.C1YynHqlxGLu6vX-krOySyWLOOTUMH7fG8gtmnBgFfw'
        }
      })

      this.employees = await res.json();
    }
  }
  componentDidMount() {
    this.getCompanies()
  }
  render(){
    return (
      <Container>
        <h1>Company</h1>
        <h3>Welcome to NF Company Management System</h3>
        <Table striped responsive>
          <thead>
            <tr>
              <th>Name</th>
              <th>Address</th>
              <th>Description</th>
            </tr>
          </thead>
          <tbody>
          {
            this.state.employees.map(e => {
              return (
                <tr key={ e.id }>
                  <td>{ e.Name }</td>
                  <td>{ e.Address }</td>
                  <td>{ e.Description }</td>
                </tr>
              )
            })
          }
          </tbody>
        </Table>
      </Container>
    );
  }
}

export default Company
